  false,\n\t\"url\": null,\n\t\"notes\": \"The TIGER/Line Files are shapefiles and
  related database files (.dbf) that are an extract of selected geographic and cartographicn
  \         information from the U.S. Census Bureau's Master Address File / Topologically
  Integrated Geographic Encoding and Referencing (MAF/TIGER) Database (MTDB). Then
  \         purpose of this file is to provide the geography for the 2010 Census Blocks
  along with their 2010 housing unit count and population. Census Blocks aren          statistical
  areas bounded on all sides by visible features, such as streets, roads, streams,
  and railroad tracks, and/or by non-visible boundaries such as city,n          town,
  township, and county limits, and short line-of-sight extensions of streets and roads.
  Blocks are the smallest geographic areas for which the Censusn          Bureau publishes
  data from the decennial census. A block may consist of one or more faces.\",\n\t\"license_title\":
